package com.demo;

public class DemoArithmetical {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

	   int a = 25;
	   int b = 10;
	   
	    System.out.println(a-b);//15
	    System.out.println(a*b);//250
	    System.out.println(a+b);//35
	    System.out.println(a%b);//0
	    }
    }








